INSERT INTO dwh_report_extract (id, version, created, code, description, category, script_type, filename_format, result_type, uuid, sql_query) VALUES (-10, 0, NOW(), 'INVOICED_S', 'Invoiced per Seller per month for interval, global filter', 'invoiced', 'SQL', 'invoiced_per_seller-[yyyyMMdd].csv', 'CSV', 'INVOICED_S_UUID', 'select trim(to_char(date_trunc(''month'', i.invoice_date), ''Month'')) || to_char(date_trunc(''month'', i.invoice_date), '' YYYY'') AS Month
