INSERT INTO dwh_report_extract (id, version, created, code, description, category, script_type, filename_format, result_type, uuid, sql_query) VALUES (-13, 0, NOW(), 'RECORDED_BA_HIERARCHY', 'Recorded per Billing Account with Hierarchy per month for interval, global filter', 'recorded', 'SQL', 'recorded_per_billing_account_hierarchy-[yyyyMMdd].csv', 'CSV', 'RECORDED_BA_HIERARCHY_UUID', 'SELECT trim(to_char(date_trunc(''month'', ao.invoice_date), ''Month'')) || to_char(date_trunc(''month'', ao.invoice_date), '' YYYY'') AS ''Month''
                ,s.code AS ''Seller code''
                ,s.description AS ''Seller
                description''
                ,ce.code AS ''Customer code''
                ,ce.description AS ''Customer description''
                ,cae.code AS ''Customer Account code''
                ,cae.description AS ''Customer Account description''
                ,bae.code AS ''Billing Account code''
                ,bae.description AS ''Billing Account description''
                ,to_char(sum(CASE
                WHEN ao.transaction_category = ''DEBIT''
                THEN ao.amount
                ELSE 0
                END), ''99999999990.00'') AS ''Amount DEBIT''
                ,to_char(sum(CASE
                WHEN
                ao.transaction_category = ''CREDIT''
                THEN ao.amount
                ELSE 0
                END), ''99999999990.00'') AS ''Amount CREDIT''
                ,to_char(sum(CASE
                WHEN ao.transaction_category = ''DEBIT''
                THEN ao.amount
                ELSE - ao.amount
                END), ''99999999990.00'')
                AS ''Balance''
                FROM crm_seller s
                INNER JOIN crm_customer c ON c.seller_id = s.id
                INNER JOIN account_entity ce ON c.id = ce.id
                INNER JOIN
                ar_customer_account ca ON ca.customer_id = c.id
                INNER JOIN account_entity cae ON ca.id = cae.id
                INNER JOIN billing_billing_account ba ON
                ba.customer_account_id = ca.id
                INNER JOIN account_entity bae ON ba.id = bae.id
                INNER JOIN billing_invoice i ON i.billing_account_id = ba.id
                INNER JOIN
                ar_account_operation ao ON ao.customer_account_id = ca.id
                AND ao.reference = i.invoice_number
                AND ao.invoice_date = i.invoice_date
                AND ao.amount = abs(i.amount_with_tax)
                WHERE
                ao.invoice_date IS NOT NULL
                AND ao.invoice_date > (date_trunc(''month'', CURRENT_DATE) - CAST(:MONTH_INTERVAL || '' month'' AS INTERVAL))
                AND (
                s.code ilike ''%'' || :SEARCH_CRITERION || ''%''
                OR s.description ilike
                ''%'' || :SEARCH_CRITERION || ''%''
                OR ce.code ilike ''%'' || :SEARCH_CRITERION || ''%''
                OR ce.description ilike ''%'' || :SEARCH_CRITERION || ''%''
                OR cae.code ilike ''%'' || :SEARCH_CRITERION || ''%''
                OR cae.description
                ilike ''%'' || :SEARCH_CRITERION || ''%''
                OR bae.code ilike ''%'' || :SEARCH_CRITERION || ''%''
                OR bae.description ilike ''%'' || :SEARCH_CRITERION || ''%''
                )
                GROUP BY date_trunc(''month'', ao.invoice_date)
                ,s.code
                ,s.description
                ,ce.code
                ,ce.description
                ,cae.code
                ,cae.description
                ,bae.code
                ,bae.description
                ORDER BY date_trunc(''month'', ao.invoice_date) DESC
                ,s.code
                ,ce.code
                ,cae.code
                ,bae.code');

