INSERT INTO dwh_report_extract (id, version, created, code, description, category, script_type, filename_format, result_type, uuid, sql_query) VALUES (-22, 0, NOW(), 'UNBILLED_C', 'Unbilled per Customer, global filter', 'unbilled', 'SQL', 'unbilled_per_customer-[yyyyMMdd].csv', 'CSV', 'UNBILLED_C_UUID', 'select ce.code AS ''Customer code''
