INSERT INTO dwh_report_extract (id, version, created, code, description, category, script_type, filename_format, result_type, uuid, sql_query) VALUES (-24, 0, NOW(), 'UNBILLED_OF', 'Unbilled per Offer, global filter', 'unbilled', 'SQL', 'unbilled_per_offer-[yyyyMMdd].csv', 'CSV', 'UNBILLED_OF_UUID', 'select of.code AS ''Offer code''
